import React from "react";
import { Box, Center, Text, Grid, Col } from "@mantine/core";

const generateMantineUIComponent = (config) => {
  const { type, props, children } = config;
  return React.createElement(type, props, children);
};

const Layout3Object = {
  type: Box,
  props: {
    bg: "gray.4",
    h: 200,
    style: { borderRadius: "10px" },
  },
};

const Layout3 = () => {
  const generatedComponent = generateMantineUIComponent(Layout3Object);
  return generatedComponent;
};

export default Layout3;
